import React from 'react'
import ToDo from './ToDo'


function ToDos(props) {
  return (
    <div className='container'>
      <h3 className='text-center'>
        To Do List
      </h3>
      <ToDo todo={props.todos[0]}/>

    </div>
  )
}

export default ToDos
